import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="header-container">
        <div className="logo">
          <img src="/path/to/logo.png" alt="Brand Logo" />
        </div>
        <div className="tagline">
          <h1>Your Trusted Branding Agency</h1>
        </div>
      </div>
    </header>
  );
}

export default Header;
